import React from 'react'
// import React, { useState, useEffect } from 'react'
import Button from '../Button';
// import { getEmprNav } from '../Data/EmprNav.data';
import * as Styled from './Card.styles';

function Card({ maisonMariaThereza, maisonEsperance }) {

  // const [navItems, setNavItems] = useState([]);
  // useEffect(() => {
  //   setnavItems(getEmprNav());
  // }, [])

  return (
    <Styled.Card>

      <div className='inner-wrapper'>
        <div className='boxContent'>
          <h4>Lançamento</h4>
          <div className='imgBox'>
            <img className='imgBox__image' src='./images/empreendimentos/empreend_MMT.png' alt='' />
          </div>

          <div className='content'>
            <div className='content__tittle'>MAISON MARIA THEREZA</div>
            <div className='content__description'>Alto padrão</div>
            <div className='content__local'>Poços de Caldas - MG</div>
            <Button onAction={ maisonMariaThereza }>Saiba mais</Button>
          </div>
        </div>
      </div>

      <div className='inner-wrapper'>
        <div className='boxContent'>
          <h4>Entregue</h4>
          <div className='imgBox'>
            <img className='imgBox__image' src='./images/empreendimentos/empreend_ME.png' alt='' />
          </div>

          <div className='content'>
            <div className='content__tittle'>MAISON ESPERANCE</div>
            <div className='content__description'>Residencial</div>
            <div className='content__local'>Estados Unidos - USA</div>
            <Button onAction={ maisonEsperance }>Saiba mais</Button>
          </div>
        </div>
      </div>

    </Styled.Card>
  )
}

export default Card;

